The primary "product" of the core crate are the async socket implementations, mirroring tokio::net. These sockets can be used just like their tokio counterparts, assuming an interface is adequatly configured The IO plugin will then consume any UDP or TCP packets and reroute their contents into the async API, finally being forwarded to the user as the result of read/write calls to the socket object. Both the UDP and TCP implementation are RFC compliant and fully featured, however without OS specific optimizations. use inet::TcpStream;
// in `at_sim_start`
tokio::spawn(async move { let sock = TcpStream::connect("192.168.0.103:8000").await?; sock.write(b"Hello world").await?; let mut buf = [0; 128]; sock.read(&mut buf).await?; assert_eq!(String::from_utf8_lossy(&buf), "Hello back");
});
